Method.Source:
[Form]
public class WMSOpenOrders extends FormRun
{
    InventDimCtrl_Frm   inventDimFormSetup;
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventDimParm   inventDimParm;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init          :
        case InventDimFormDesignUpdate::LinkActive    :
            inventDimParm.initProductDimensionsAllGroups();
            inventDimParm.initSiteDimAllGrp();
            inventDimParm.InventLocationIdFlag = true;
            if (!inventDimFormSetup)
                inventDimFormSetup  = InventDimCtrl::newFromForm(element);
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);

        case InventDimFormDesignUpdate::Active        :
            inventDimFormSetup.formActiveSetup();
            inventDimFormSetup.formSetControls(true);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

public void delete()
{
    if (wmsOrder.Status == WMSOrderStatus::Complete)
    {
        if (Box::yesNo("@SYS70566",DialogButton::No,"@SYS6998","@SYS6998") == 0)
        {
            return;
        }
    }
    super();
}

public int active()
{
    int ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    return ret;
}

void init()
{
    QueryBuildRange qbrQtyNoShipment;
    QueryBuildRange queryStatus;
    QueryBuildRange qbrOrderType;

    QueryBuildDataSource qbds;

    super();
    qbds = this.query().dataSourceTable(tableNum(WMSOrder));

    qbrOrderType        = SysQuery::findOrCreateRange(qbds, fieldNum(WMSOrder, Type));
    qbrQtyNoShipment    = SysQuery::findOrCreateRange(qbds, fieldNum(WMSOrder, QtyNoShipment));

    //qty not in shipment and status new means that order is not being processed
    if (qbrQtyNoShipment)
    {
        qbrQtyNoShipment.value(SysQuery::valueNot(0));
        qbrQtyNoShipment.status(RangeStatus::Hidden);
    }

    queryStatus = SysQuery::findOrCreateRange(qbds,fieldNum(WMSOrder, Status));

    if (queryStatus)
    {
        queryStatus.value(queryValue(WMSOrderStatus::New));
        queryStatus.status(RangeStatus::Hidden);
    }

    if (qbrOrderType)
    {
        qbrOrderType.value(enum2Value(WMSOrderType::OrderPick));
        qbrOrderType.status(RangeStatus::Hidden);
    }

    this.query().dataSourceTable(tableNum(WMSOrder)).addRange(fieldNum(WMSOrder, OrderId));
}

boolean validate()
{
    boolean ret;

    ret = super();

    if (wmsOrder.Qty <= 0)
    {
        ret = checkFailed("@SYS53673");
    }

    return ret;
}

void clicked()
{
    boolean enabled = true;

    if (wmsOrder.Status == WMSOrderStatus::Complete && wmsOrder.InventTransRefId)
    {
        enabled = false;
    }
    inventTrans_button.enabled(enabled);
    super();
}

void clicked()
{
    wmsOrderFinish.enabled(wmsOrder.OrderId && wmsOrder.Status == WMSOrderStatus::New);
    wmsCreateOrderPickData.enabled(wmsOrder.OrderId && wmsOrder.Type == WMSOrderType::OrderPick);
    super();
}
